import {Container} from 'react-bootstrap';

function endYear(y){
    if (y === undefined)
        return "Ongoing";
    else
        return y;
}

function Listing(props){
    return (
    <Container>
        <h3>{props.title}</h3>
        <h5 className="Tagline"> {props.location}</h5>
        <p> {props.startYear}-{endYear(props.endYear)}</p>
        <li> {props.description}</li>
    </Container>
    )
} export default Listing;
